import React from "react";
import {  
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button,
} from "reactstrap";
//import './defaultStadium.jpg'

const Stadiums = () => {
  return (
    <div>
      <Card  style={{width:'200px' ,marginTop:'50px'}}>
      <Badge pill>14</Badge>
        <CardImg top width="50%" src="defaultStadium.jpg" alt="Card image cap" />
        <CardBody width="200px">
          <CardTitle>Maracana-Ezzahra</CardTitle>
          <CardSubtitle>Ben Arous</CardSubtitle>
          <CardText>
            25 Rue chedly hamouda
          </CardText>
          <Button>Access</Button>
        </CardBody>
      </Card>
    </div>
  );
};

export default Stadiums;
